import React from 'react';
import './Contacts.scss'

function Contacts() {
    return ( 

        <section className='contact--container'>
            <h1>Vamos nos conhecer!</h1>
          <form>
          <input class="form--contact" type="text" autocomplete="off" name="Nome" placeholder="Nome Completo" required> </input>
            

          </form>
        </section>
        

     );
}

export default Contacts;
